Ja tyvärr missade jag själv detta evenemang eftersom jag var upptagen hela lördagen med sångutbildning! Varför ska allt kul vara samtidigt? Typiskt&hellip;
Som tur är fick jag chansen att medverka i allafall med några bilder som visades i en fotoutställning av Folkutbildningsuniversitetet. Skoj! Såg mina egna bilder i bakgrunden en par gånger på fejjan från mässan&hellip; Humor! :)
